import React from 'react'
import { poster_url } from '../utils/constants'
const MoviesCard = ({title,poster_path}) => {
  return (
    <div>
        <h1>{title}</h1>
        <h2>{poster_path}</h2>
    </div>
  )
}

export default MoviesCard
